<!DOCTYPE html>
<html>

<head>
  <title>Timed Event Graphs</title>
  <script type="text/javascript" src="jquery-3.7.1.slim.min.js"></script>
  
  <!-- Custom styling for buttons -->
  <style>
    /* Start button with green background */
    #startSimulation {
      background-color: #4CAF50;
    }

    /* Start button hover effect */
    #startSimulation:hover {
      background-color: #45a049;
    }

    /* Reset button styling */
    input[type="submit"][value="Reset"] {
      background-color: #f44336;
    }

    /* Reset button hover effect */
    input[type="submit"][value="Reset"]:hover {
      background-color: #da190b;
    }
  </style>
</head>

<body>
	<center>
    <h1>Timed Event Graphs</h1>
    <!-- Control buttons table -->
    <table frame="border">
      <tr>
        <!-- Button to start or restart the simulation -->
        <td><input id="startSimulation" type="submit" value="(re)Start Simulation" /></td>

        <!-- Button to pause the ongoing simulation -->
        <td><input id="stopSimulation" type="submit" value="Pause Simulation" /></td>

        <!-- Button to reset the page (reloads everything) -->
        <td colspan="3"><input type="submit" value="Reset" onclick="location.reload();" /></td>
      </tr>
    </table>
   </center>

<script>

    // Start the simulation and display clock 
    // Don't need to change!!!
    $("#startSimulation").click(function() {
      $svg = $("#myget");
      Animation();
    });

    // Pause the simulation and hide the clock
    // Don't need to change!!!
    $("#stopSimulation").click(function() {
      $svg = $("#myget");
      clearInterval(myVar);
    });

    // Display the current time on the clock every second
    // Don't need to change!!!
    function showTime() {
      var today = new Date();
      var h = today.getHours();
      var m = today.getMinutes();
      var s = today.getSeconds();

      // Add a leading zero for numbers < 10
      h = checkTime(h);
      m = checkTime(m);
      s = checkTime(s);

      $svg = $("#myget");
      $('#horloge', $svg).text(h + ":" + m + ":" + s);

      // Refresh the clock every second
      t = setTimeout('showTime()', 1000);
    }

    // Add leading zero for single digit numbers
    // Don't need to change!!!
    function checkTime(i) {
      if (i < 10) {
        i = "0" + i;
      }
      return i;
    }

    // Create a 2D matrix (m rows, n columns) filled with an initial value
    // Don't need to change!!!
    Array.matrix = function(m, n, initial) {
      var a, i, j, mat = [];
      for (i = 0; i < m; i++) {
        a = [];
        for (j = 0; j < n; j++) {
          a[j] = initial;
        }
        mat[i] = a;
      }
      return mat;
    };

    // Create a 1D vector of given dimension filled with an initial value
    // Don't need to change!!!
    Array.vect = function(dimension, initial) {
      var a = [], i;
      for (i = 0; i < dimension; i++) {
        a[i] = initial;
      }
      return a;
    }

// This is the first function called
// Don't need to change!!!
$(document).ready(function() {
  var i;

  $svg = $("#myget");

  showTime();     // Start the clock
  initGET();      // Initialize the graph structure and tokens
});

// Show all tokens in the uncontrolled system based on the token matrices
// Don't need to change!!!
function ShowToken() {
  var i, j, k;
  $svg = $("#myget");
  // Tokens on XX arcs
  for (i = 0; i < sXX.length; i++)
    for (j = 0; j < sXX[i].length; j++) {
      if (sXX[i][j] > 5) {
        $('#x' + (i + 1) + 'x' + (j + 1), $svg).show();
      } else {
        for (k = 1; k <= sXX[i][j]; k++) {
          $('#x' + (i + 1) + 'x' + (j + 1) + '_' + k, $svg).show();
        }
      }
    }
}


// Hide all token elements from the SVG (both small and large) for both systems
function HideToken() {
  $svg = $("#myget");

  // Hide all small tokens for uncontrolled and controlled systems
    // Uncontrolled system small tokens
    // Remember to obey the standard form on your svg file!!!
    $('#x2x1_1', $svg).hide();
    $('#x3x2_1', $svg).hide();
    $('#x1x3_1', $svg).hide();
    $('#x2x4_1', $svg).hide();
    $('#x5x1_1', $svg).hide();
    $('#x5x4_1', $svg).hide();
    $('#x6x5_1', $svg).hide();
    $('#x4x6_1', $svg).hide();

    $('#x8x7_1', $svg).hide();
    $('#x9x8_1', $svg).hide();
    $('#x7x9_1', $svg).hide();
    $('#x10x7_1', $svg).hide();
    $('#x8x11_1', $svg).hide();
    $('#x10x12_1', $svg).hide();
    $('#x11x10_1', $svg).hide();
    $('#x12x11_1', $svg).hide();


}


// ============================
// Global Variables and Settings
// Modify these based on your net structure
// ============================

// Timer reference for controlling animation intervals
var myVar;

// Graph structure dimensions (number of transitions)
var sizeX = 12;

// Counter domain (max delay time of a place after a transition) - Uncontrolled
var TmaxX = 89;

// Dater domain (max number of tokens in a place after a transition) - Uncontrolled
var kmaxX = 1;

// State vectors (counter domain) without controller
// Don't change!!!
var vX = Array.matrix(sizeX, TmaxX + 1, 0);

// State vectors (dater domain) without controller
// Don't change!!!
var kX = Array.matrix(sizeX, kmaxX + 1, 0);

// State matrices (counter domain) without controller
// Don't change!!!
var sXX = Array.matrix(sizeX, sizeX, Number.NEGATIVE_INFINITY); // internal X to X

// State matrices (dater domain) without controller
// Don't change!!!
var kXX = Array.matrix(sizeX, sizeX, Number.NEGATIVE_INFINITY);

// ============================
// Initialization of the Graph
// Modify these based on your net structure and initial tokens
// ============================
function initGET() {
  var i, j, k;

  // Initialize token counts for arcs (uncontrolled)
  sXX[2][1] = 1;
  sXX[4][3] = 1;

  sXX[10][9] = 1; 
  sXX[7][6] = 1;

  // Reset token visibility and render tokens on graph
  HideToken();
  ShowToken();
}


// ============================
// Simulation Animation Step
// This function is very important in order to represent the real system, 
// so take care when changing each index
// ============================
function Animation() {
  var i, j;

  // ========== WITHOUT CONTROLLER ==========
  // This section defines the system dynamics without any controller (open loop).
  // To model a new system, you only need to know:
  // - The delay between transitions (used in +N and indexing shifts)
  // - The number of initial tokens on each arc (added with "+ N" in stock update equations)

  // Place dynamics (x): define timing rules between transitions based on system delays
  vX[0][TmaxX] = Math.min(vX[2][TmaxX - 4]);
  vX[1][TmaxX] = Math.min(vX[0][TmaxX - 49], vX[3][TmaxX]);
  vX[2][TmaxX] = Math.min(vX[1][TmaxX - 67] + 1);
  vX[3][TmaxX] = Math.min(vX[5][TmaxX - 4]);
  vX[4][TmaxX] = Math.min(vX[3][TmaxX - 71] + 1, vX[0][TmaxX]);
  vX[5][TmaxX] = Math.min(vX[4][TmaxX - 45]);

  vX[6][TmaxX] = Math.min(vX[8][TmaxX - 4]);
  vX[7][TmaxX] = Math.min(vX[6][TmaxX - 36] + 1, vX[10][TmaxX]);
  vX[8][TmaxX] = Math.min(vX[7][TmaxX - 80]);
  vX[9][TmaxX] = Math.min(vX[6][TmaxX], vX[11][TmaxX - 4]);
  vX[10][TmaxX] = Math.min(vX[9][TmaxX - 27] + 1);
  vX[11][TmaxX] = Math.min(vX[10][TmaxX - 89]);


  // Stock update (number of tokens on each arc)
  // Modify these based on your net structure and initial tokens
  sXX[1][0] = vX[0][TmaxX] - vX[1][TmaxX];
  sXX[2][1] = vX[1][TmaxX] - vX[2][TmaxX] + 1;         
  sXX[0][2] = vX[2][TmaxX] - vX[0][TmaxX];     
  sXX[4][3] = vX[3][TmaxX] - vX[4][TmaxX] + 1;         
  sXX[5][4] = vX[4][TmaxX] - vX[5][TmaxX];     
  sXX[3][5] = vX[5][TmaxX] - vX[3][TmaxX];     
  sXX[4][0] = vX[0][TmaxX] - vX[4][TmaxX];
  sXX[1][3] = vX[3][TmaxX] - vX[1][TmaxX];
  
  sXX[7][6] = vX[6][TmaxX] - vX[7][TmaxX] + 1;
  sXX[8][7] = vX[7][TmaxX] - vX[8][TmaxX];         
  sXX[6][8] = vX[8][TmaxX] - vX[6][TmaxX];     
  sXX[10][9] = vX[9][TmaxX] - vX[10][TmaxX] + 1;         
  sXX[11][10] = vX[10][TmaxX] - vX[11][TmaxX];     
  sXX[9][11] = vX[11][TmaxX] - vX[9][TmaxX];     
  sXX[9][6] = vX[6][TmaxX] - vX[9][TmaxX];
  sXX[7][10] = vX[10][TmaxX] - vX[7][TmaxX];

  // Dater domain equations (max,+ algebra)
  // These equations compute the occurrence time of each event (used for visualization/timing)

  kX[0][kmaxX] = Math.max(kX[2][kmaxX] + 4);
  kX[1][kmaxX] = Math.max(kX[0][kmaxX] + 49, kX[3][kmaxX]);
  kX[2][kmaxX] = Math.max(kX[1][kmaxX - 1] + 67);
  kX[3][kmaxX] = Math.max(kX[5][kmaxX] + 4);
  kX[4][kmaxX] = Math.max(kX[3][kmaxX - 1] + 71, kX[0][kmaxX]);
  kX[5][kmaxX] = Math.max(kX[4][kmaxX] + 45);

  kX[6][kmaxX] = Math.max(kX[8][kmaxX] + 4);
  kX[7][kmaxX] = Math.max(kX[6][kmaxX - 1] + 36, kX[10][kmaxX]);
  kX[8][kmaxX] = Math.max(kX[7][kmaxX] + 80);
  kX[9][kmaxX] = Math.max(kX[11][kmaxX] + 4, kX[6][kmaxX]);
  kX[10][kmaxX] = Math.max(kX[9][kmaxX - 1] + 27);
  kX[11][kmaxX] = Math.max(kX[10][kmaxX] + 89);

  // Make sure the "#myget" is the same "id = myget" in the svg file
  $svg = $("#myget");

  // =============== SHIFT MEMORY STATES =================
  // Shift all elements to the left (simulate time progress)
  // Do not change!
  for (i = 0; i < vX.length; i++) for (j = 0; j < TmaxX; j++) vX[i][j] = vX[i][j + 1];
  for (i = 0; i < kX.length; i++) for (j = 0; j < kmaxX; j++) kX[i][j] = kX[i][j + 1];

  // Refresh display of tokens in both systems
  HideToken();
  ShowToken();

  // Schedule next simulation step
  myVar = setTimeout(Animation, 1000);
}
